```bash
cat <<'EOF' > layout.css
/* CSS Grid Layout for a Page with Header, Sidebar, Main Content, and Footer */

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  min-height: 100vh;
  display: grid;
  grid-template-areas:
    "header header header header"
    "sidebar main main main"
    "footer footer footer footer";
  grid-template-rows: auto 1fr auto;
  grid-template-columns: 250px 1fr;
  font-family: Arial, sans-serif;
}

/* Header spans full width at top */
header {
  grid-area: header;
  background-color: #333;
  color: white;
  padding: 1rem;
  text-align: center;
}

/* Sidebar on the left with fixed width (250px) */
sidebar {
  grid-area: sidebar;
  background-color: #444;
  padding: 1.5rem;
  color: white;
}

/* Main content takes remaining space */
main {
  grid-area: main;
  background-color: #f4f4f4;
  padding: 1.5rem;
}

/* Footer spans full width at bottom */
footer {
  grid-area: footer;
  background-color: #333;
  color: white;
  text-align: center;
  padding: 1rem;
}
EOF
```

